import React from "react";
import {Navlink} from 'react-router-dom';

const Prjct=()=>
{
    return(
        <>
        <h1>Welcome to my website !!</h1>
        <Navlink To='/'>Home</Navlink>
        <Navlink To='/About'>About</Navlink>
        <Navlink To='/Services'>Services</Navlink>


        </>
    )
}

export default Prjct;
